import { createSelector } from 'reselect';
import { RootState } from '../store';

enum COLLECTION_ID_MAP {
  hats,
  sneakers,
  jackets,
  womans,
  mens,
}

const selectShop = (state: RootState) => state.shop;

export const selectShopCollections = createSelector(
  selectShop,
  (shop) => shop.collections
);
